import React from 'react';
import {BookListJson} from './BookListJson';


function ShowBookItem(item){
    return(
        <h1>item.bookName</h1>
    )

}
class BookList extends React.Component
{
    
    render()
    {
        return(
            <div>
                <h1>Hello BookList</h1>
                {BookListJson.map(ShowBookItem)}
            </div>

        );
    }


}
export default BookList;
